import React from "react";
import "./Filterbox.component.css";

const Filterbox = (props) => {
  const selectedFilters = props.activeFilters.map((filter) => {
    return (
      <div className='filterbox__filter'>
        <p>{filter}</p>
        <button></button>
      </div>
    );
  });

  return (
    <section className='filterbox'>
      <div className='filterbox__filters-wrapper'>{selectedFilters}</div>
      <div className='filterbox__clear'>
        <button>Clear</button>
      </div>
    </section>
  );
};

export default Filterbox;
